INSERT INTO `movie` (`id`, `name`, `slug`, `original_name`, `total_episodes`, `description`, `time`, `thumb_url`, `poster_url`, `id_category`, `id_country`, `id_genre`, `quality`, `language`, `director`, `casts`, `hot`, `hot_slider`, `trailer_url`, `status`) VALUES
(187, 'New Initial D Movie: Legend 3 - Mugen', 'new-initial-d-movie-legend-3-mugen', 'Initial D Legend 3: Dream, Shin Gekijouban Initial D: Legend 3 - Mugen', 1, 'Sau một mùa hè tranh tài với những tay đua hàng đầu Gunma, Fujiwara Takumi nhận được lời thách đấu chính thức từ Ryousuke Takahashi, thủ lĩnh đội Akagi Red Suns. Dù ban đầu không mấy hào hứng với thú vui đua xe, Takumi không khỏi cảm thấy phấn khích khi đối đầu với \"Sao băng trắng Akagi\" huyền thoại.', NULL, 'https://phim.nguonc.com/public/images/Film/76759.jpg', 'https://phim.nguonc.com/public/images/Film/76759.jpg', 74, 7, '1', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(188, 'New Initial D Movie: Legend 2 - Tousou', 'new-initial-d-movie-legend-2-tousou', 'Initial D Legend 2 Racer, Shin Gekijouban Initial D: Legend 2 - Tousou', 1, 'Sau khi chứng kiến cuộc đua giữa Toyota AE86 của Takumi Fujiwara và Mazda RX7 của Keisuke Takahashi, Takeshi Nakazato thuộc đội Đêm Myougi thách đấu AE86 trong một trận đua đổ đèo. Mặc dù chiếc Nissan Skyline GT-R của Nakazato hoàn toàn vượt trội so với AE86, nhưng anh ta lại được cảnh báo rằng sẽ không bao giờ thắng được Takumi - điều này khiến anh ta tức giận.', NULL, 'https://phim.nguonc.com/public/images/Film/72246.jpg', 'https://phim.nguonc.com/public/images/Film/72246.jpg', 74, 7, '1', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(189, 'New Initial D Movie: Legend 1 - Kakusei', 'new-initial-d-movie-legend-1-kakusei', 'Initial D Legend 1 Awakening, Shin Gekijouban Initial D: Legend 1 - Kakusei', 1, 'Sương mù bao phủ một buổi sáng, chiếc Toyota AE86 đen trắng phóng vụt qua chiếc Mazda RX7 của Takahashi Keisuke trên núi Akina. Keisuke tin rằng mình đã nhìn thấy bóng ma của một tay đua đã chết trên núi. Quyết tâm đánh bại bóng ma này, Keisuke tập hợp đội Akagi Red Suns để thi đấu với đội đua địa phương Akina Speed Stars trong một cuộc đua giao hữu. Anh ta dự đoán cuộc thi sẽ dụ \"Bóng ma Akina\" bí ẩn xuất hiện và cho anh ta cơ hội trả thù cho thất bại trước đó.', NULL, 'https://phim.nguonc.com/public/images/Film/75648.jpg', 'https://phim.nguonc.com/public/images/Film/75648.jpg', 74, 7, '1', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(190, 'Trọng Án Trung Cảng', 'trong-an-trung-cang', '省港一號通緝犯 - Rock N\'Roll Cop', 1, 'Một cảnh sát Hồng Kông được gửi đến Trung Quốc đại lục để truy tìm một nhóm sát nhân. Trong khi đó, một người cảnh sát khác phát hiện ra người tình cũ của mình đang hỗ trợ một băng đảng tội phạm nguy hiểm.', '92 phút', 'https://phim.nguonc.com/public/images/Post/I5NjE%40__V1_.jpg', 'https://phim.nguonc.com/public/images/Post/MDI5NjE%40__V1_.jpg', 75, 7, '1', '1', '1', 'Hoàng Chí Cường', 'Huỳnh Thu Sinh, Ngô Hưng Quốc, Vu Vinh Quang, Ngô Gia Lệ, Minh Trân Trân', 1, NULL, NULL, 1),
(191, 'Touken Ranbu Kai: Kyoden Moyuru Honnouji', 'touken-ranbu-kai-kyoden-moyuru-honnouji', '刀剣乱舞 廻 -虚伝 燃ゆる本能寺-', 8, 'Một ngày nọ, một Đao Kiếm Nam Sĩ mới xuất hiện tại Bản doanh của họ. Fudou Yukimitsu: Một thanh kiếm được sử dụng bởi một võ tướng thời Sengoku, Oda Nobunaga, sau đó đã được ông trao lại cho Mori Ranmaru, cận vệ của mình. Fudou Yukimitsu tỏ ra tự hào mình là ái kiếm của Oda Nobunaga, nhưng lại không hòa hợp với những thanh kiếm cũng có cùng chủ nhân trước là Nobunaga: Souza Samonji, Heshikiri Hasebe, và Yagen Toushirou.', NULL, 'https://phim.nguonc.com/public/images/Film/142048.jpg', 'https://phim.nguonc.com/public/images/Film/142048.jpg', 73, 7, '8', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(194, 'Cõng Anh Mà Chạy', 'cong-anh-ma-chay', 'Lovely Runner', 16, 'Cõng Anh Mà Chạy (Lovely Runner) là một bộ phim Hàn Quốc thuộc thể loại tâm lý, tình cảm của đạo diễn Yoon Jong Ho, Kim Tae Yeop, được chuyển thể từ webtoon nổi tiếng The Best Of Tomorrow, mang đến cho người xem một câu chuyện tình xuyên thời gian vô cùng lãng mạn. Ở phim này, sẽ có sự tham gia của các diễn viên: Kim Hye Yoon, Byeon Woo Seok, Song Geon Hee, Lee Seung Hyeob,...Phim Cõng Anh Mà Chạy kể về câu chuyện trong vương quốc hào nhoáng của ngôi sao, Ryu Seon Jae tỏa sáng như một người nổi tiếng hàng đầu, thu hút sự chú ý kể từ khi ra mắt. Bất chấp bề ngoài của một cuộc sống hoàn hảo, tính chất khắt khe của ngành giải trí đã khiến anh hoàn toàn kiệt sức. Im Sol, một người hâm mộ cuồng nhiệt, có tình yêu nồng nàn với Ryu Seon Jae. Một tai nạn thời thơ ấu đã làm hỏng ước mơ của cô, nhưng niềm an ủi trong âm nhạc của Ryu Seon Jae trên radio đã biến cô thành một người hâm mộ cuồng nhiệt. Câu chuyện chuyển sang một bước ngoặt sâu sắc khi Im Sol, quay cuồng với tin tức nóng hổi về cái chết bi thảm của Ryu Seon Jae, trải qua một bước ngoặt kỳ diệu của số phận. Trở về quá khứ 15 năm trước, cô đối đầu với Ryu Seon Jae khi anh còn là học sinh trung học 19 tuổi. Im Sol vật lộn với thử thách ghê gớm trong việc thay đổi quỹ đạo tương lai của mình, được thúc đẩy bởi quyết tâm kiên cường nhằm ngăn chặn thảm kịch sắp xảy ra.', '70 phút/tập', 'https://phim.nguonc.com/public/images/Post/x4K4VE_4f.jpg', 'https://phim.nguonc.com/public/images/Post/BdmAD1_3f.jpg', 73, 7, '9', '1', '1', 'Kim Tae-yeob', 'Byeon Woo-seok, Kim Hye-yoon, Song Geon-hee', 1, 1, NULL, 1),
(196, 'Thiếu Niên Diệp Vấn: Thời Khắc Nguy Hiểm', 'thieu-nien-diep-van-thoi-khac-nguy-hiem', 'Young Ip Man: Crisis Time', 1, 'Hồi trẻ, Diệp Vấn đã tới Hồng Kông học tập. Khi đang tham gia cuộc thi diễn thuyết tiếng Anh ở trường, đột nhiên xảy ra vụ bắt cóc tống tiền, Diệp Vấn đã giao đấu với băng đảng xã hội đen. Âm mưu bắt cóc của tên trùm xã hội đen bị vạch trần, mối quan hệ của Diệp Vấn và hắn cũng được hé mở. Thiếu niên Diệp Vấn nên làm thế nào để giữ vững chính nghĩa trong lòng mình?', '78 phút', 'https://phim.nguonc.com/public/images/Film/thieu-nien-diep-van-thoi-khac-nguy-hiem-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/thieu-nien-diep-van-thoi-khac-nguy-hiem-poster.jpg', 73, 7, '8', '1', '1', 'Li Li Ming', 'Triệu Văn Hạo, Mâu Phượng Bân, Hao-xuan Li, Shao Xia', 1, NULL, NULL, 1),
(198, 'Chưởng Giáo Tông Môn Ẩn Thế', 'chuong-giao-tong-mon-an-the', '隐世宗门掌教, Yin Shi Zong Men Zhang', 52, 'Giang Bắc Thần xuyên không tới thế giới huyền huyễn, ngẫu nhiên có được hệ thống chưởng giáo mạnh nhất, thành lập nên \"Tiên Đạo Môn\". Ban đầu Giang Bắc Thần chỉ có thể giả dạng phong thái cao nhân, lừa lọc Khí Vận Chi Tử để thăng cấp tông môn, nhưng sau này hắn dần dần phát hiện tông môn nhỏ của mình lại thật sự trở thành ẩn thế tông môn đứng trên đỉnh kim tự tháp.', NULL, 'https://phim.nguonc.com/public/images/Film/904554.jpeg', 'https://phim.nguonc.com/public/images/Film/904554.jpeg', 73, 7, '2', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(199, 'Thiếu Niên Ca Hành 3', 'thieu-nien-ca-hanh-3', 'Great Journey of Teenagers Season 3, Shaonian Ge Xing 3', 26, 'Sau khi Trương Trì bay khỏi đường đua bị thương nặng, vô tình xuyên vào cơ thể Lâm Trăn Đông chỉ mới 21 tuổi, anh đã nghĩ đủ mọi cách để ngăn cản mình lúc 24 tuổi bước lên vết xe đổ.', NULL, 'https://phim.nguonc.com/public/images/Film/thieu-nien-ca-hanh-3-3d_250x350.jpeg', 'https://phim.nguonc.com/public/images/Film/thieu-nien-ca-hanh-3-3d_250x350.jpeg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(200, 'Chân Võ Đỉnh Phong 2', 'chan-vo-dinh-phong-2', 'Zhen Wu Dianfeng 2nd Season, The Peak of True Martial Arts 2nd Season', 156, 'Mùa thứ 2 của Chân Võ Đỉnh Phong.', NULL, 'https://phim.nguonc.com/public/images/Film/135536.jpg', 'https://phim.nguonc.com/public/images/Film/135536.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(203, 'Ron Kamonohashi: Thám Tử Loạn Trí', 'ron-kamonohashi-tham-tu-loan-tri', 'Kamonohashi Ron no Kindan Suiri, Ron Kamonohashi\'s Forbidden Deductions, Ron Kamonohashi: Deranged Detective', 13, 'Câu chuyện xoay quanh anh chàng thám tử “điên” KAMONOHASHI Ron và thanh tra mới vào ngành ISSHIKI Totomaru. Từng là một thám tử nổi tiếng, thế nhưng Ron lại quyết định ở ẩn và không tham gia phá án chính vì vậy, nhiều người đã đồn rằng anh ta là một chàng thám tử điên rồ.', NULL, 'https://phim.nguonc.com/public/images/Film/137123.jpg', 'https://phim.nguonc.com/public/images/Film/137123.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(204, 'Khó Tìm (Nan Tầm)', 'kho-tim-nan-tam', 'Hard to Find', 28, 'Khó Tìm (Nan Tầm) là câu chuyện kể về Công chúa Phượng Diên và Thiếu gia Lâm Xuyên Liên Hi. Trên vùng đất Cửu Trạch, Tích Cựu, con trai cả của tộc Sóc Vân, chuẩn bị kết hôn với vị hôn thê Lương Thiềm, nhưng Lương Thiềm bị bắt cóc bởi vị thiếu gia Lâm Xuyên bí ẩn - Hách Liên Hi vào đêm trước đám cưới. Hách Liên Hi ép Lương Thiềm giao ra Liên Lý Chi, người có thể hồi sinh gia tộc Lâm Xuyên, tuy nhiên Lương Thiềm không biết Liên Hi đang nói về cái gì do cô bị mất trí nhớ. Tuy nhiên, khi Hách Liên Hi đưa Lương Thiềm đến cõi tâm thức của cây thiêng, quá khứ bụi bặm dần dần được đánh thức, Lương Thiềm cuối cùng cũng nhớ ra rằng cô từng là vợ của Liên Hi, cô chính là công chúa Phượng Diên của Lâm Xuyên. Cô và việc Lâm Xuyên bị diệt vong có một mối quan hệ không thể tránh khỏi... Cả hai vốn là một cặp được định sẵn để nên duyên, tuy nhiên, họ đã đưa ra quyết định riêng cho cuộc sống của mình, điều này gây ra những thay đổi lớn trong gia tộc. Khi cả hai đoàn tụ, một cuộc chiến cám dỗ và lôi kéo, một câu chuyện tình mang hương vị phương Đông và sự cứu rỗi đã bắt đầu.', '22 phút/tập', 'https://phim.nguonc.com/public/images/Post/PostCategory/jQ2Jlz_4f.jpg', 'https://phim.nguonc.com/public/images/Post/PostCategory/qYAd8B_3f.jpg', 73, 7, '5', '1', '1', 'Chu De Jian', 'Fang Xiao Dong, Guo Jia Yu, Kay Song, Shen Yu Jie, Wang Ze Xuan, Zhao Yi Qin', 1, NULL, NULL, 1),
(205, 'Vạch Trần Tội Ác', 'vach-tran-toi-ac', 'Nothing Uncovered', 16, 'Phim kể về Seo Jung Won (Kim Ha Neul thủ vai) là phóng viên điều tra và là người dẫn chương trình truyền hình thời sự “Let’s Get Grabbed by the Collar”. Nhờ cách vạch trần độc đáo và thẳng thắn tất cả các loại hành vi sai trái do thủ phạm gây ra đồng thời đưa ra những nhận xét mỉa mai cô ấy đã trở nên nổi tiếng và thu hút sự chú ý của công chúng. …', '70 phút/tập', 'https://phim.nguonc.com/public/images/Post/1/x4KP3j_4f.jpg', 'https://phim.nguonc.com/public/images/Post/1/fad0e81c86.jpg', 73, 7, '1', '1', '1', 'Lee Ho Jae', 'Kim Ha Neul, Yeon Woo Jin, Jang Seung Jo, Jung Woong In', 1, 1, NULL, 1),
(210, 'Bạch Nương Tử Truyền Kỳ', 'bach-nuong-tu-truyen-ky', 'The Legend of White Snake', 50, 'Tân Bạch Nương Tử Truyền Kỳ phiên bản truyền hình của Triệu Nhã Chi được xem là phiên bản kinh điển, tiêu biểu và gây được ấn tượng sâu đậm trong lòng khán giả nhất. Sự đoan trang đại lượng, cao quý dịu dàng của Triệu Nhã Chi đã tạo nên hình ảnh một Bạch Xà được khán giả yêu thích nhất, đây cũng là phiên bản được phát sóng lại nhiều nhất trên truyền hình, một phiên bản bất hủ luôn được khán giả đón nhận.', '40 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/300893204_177568721422820_715044796291969615_n-e1661220679651.jpg', 'https://phim.nguonc.com/public/images/Post/10492006_919415261482849_745972675318663502_n.jpg', 73, 7, '5', '1', '1', NULL, 'Triệu Nhã Chi, Diệp Đồng, Trần Mỹ Kỳ', 1, NULL, NULL, 1),
(211, 'Nghịch Thiên Kỳ Án 2', 'nghich-thien-ky-an-2', 'Sinister Beings 2', 30, 'Hai thanh tra cao cấp Hứa Tuấn Sâm (do Trần Triển Bằng đóng) và Thẩm Vi Lực (do Huỳnh Trí Hiền đóng) cùng làm việc cho Tổ điều tra tội phạm có tổ chức và Tam hiệp hội OCTB hay Điểm O (Organised Crime and Triad Bureau). Bằng trí thông minh và khả năng quan sát nhạy bén, họ phá được nhiều vụ án. Tội phạm nguy hiểm Ngụy Tử Lạc (do Trương Dĩnh Khang đóng) mất trí nhớ và bị giam trong bệnh viện tâm thần. Trước khi bị bắt, Lạc chuyển ra nước ngoài một số tiền lớn, không lâu sau có người thần bí tấn công khủng bố. Tuấn Sâm và Vi Lực phá được án nhờ sự giúp sức của giáo sư Đường Quán Phong (do Phương Lực Thân đóng), nhưng lại phát hiện đằng sau Tử Lạc có ẩn chứa âm mưu lớn hơn.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/2/qYo0p2_4f.jpg', 'https://phim.nguonc.com/public/images/Post/2/sQvY5pN.jpg', 73, 7, '5', '1', '1', NULL, 'Trần Triển Bằng, Lâm Hạ Vy, Phùng Doanh Doanh, Huỳnh Trí Hiền, Tưởng Tổ Mạn', 1, NULL, NULL, 1),
(212, 'Ripley (phần 1)', 'ripley-phan-1', 'Ripley (season 1)', 8, 'Một kẻ lừa đảo bị cuốn vào thế giới giàu có và đặc quyền sau khi nhận được công việc đặc biệt ở Ý. Nhưng để có được cuộc sống như mong muốn, hắn phải dựng lên vô số lời dối trá.', '50 phút/tập', 'https://phim.nguonc.com/public/images/Post/4OTc3MTY%40__V1_.jpg', 'https://phim.nguonc.com/public/images/Post/59e10c35f.jpg', 73, 7, '5', '1', '1', 'Steven Zaillian', 'Andrew Scott, Dakota Fanning, Johnny Flynn', 1, NULL, NULL, 1),
(213, 'Anthracit (phần 1)', 'anthracit-phan-1', 'Anthracit (season 1)', 6, 'Một vụ án cũ được lật mở khi một phóng viên mất tích, khiến cô con gái là thám tử mạng của anh đến thị trấn miền núi nhỏ bị ám ảnh bởi một giáo phái, bí mật và cái chết.', '50 phút/tập', 'https://phim.nguonc.com/public/images/Post/p26893419_b_v8_aa.jpg', 'https://phim.nguonc.com/public/images/Post/Anthracite-Key-Art-1-1024x576.jpg', 73, 7, '5', '1', '1', NULL, 'Hatik, Noémie Schmidt, Camille Lou', 1, NULL, NULL, 1),
(219, 'Henjin no Salad Bowl', 'henjin-no-salad-bowl', 'Salad Bowl of Eccentrics', 12, 'Nụ cười thuần thiết trong thế giới hỗn loạn, đứa con từ thế giới bên kia!Chàng thám tử nghèo nàn, Kaburaya Sosuke tình cờ gặp một cô gái kì lạ tự xưng là công chúa đến từ một thế giới khác có khả năng sử dụng phép thuật. Vì cuộc đời đưa đẩy, hai người họ bắt đầu sống chung với nhau.', NULL, 'https://phim.nguonc.com/public/images/Film/141482.jpg', 'https://phim.nguonc.com/public/images/Film/141482.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(220, 'Đấu La Đại Lục 2: Tuyệt Thế Đường Môn', 'dau-la-dai-luc-2-tuyet-the-duong-mon', 'Douluo Dalu II: Jueshi Tangmen, Soul Land 2, Combat Continent 2, Peerless Tang Sect', 52, 'Nơi này không có ma pháp, không có đấu khí, không có võ thuật, lại có võ hồn. Sau khi Đường Môn được sáng lập hơn vạn năm trên đại lục Đấu La, Đường Môn suy thoái. Một thế hệ anh tài trời sinh xuất thế, Sử Lai Khắc Thất Quái đời mới liệu có thể trọng chấn Đường Môn, viết nên một khúc nhạc về Tuyệt Thế Đường Môn?', NULL, 'https://phim.nguonc.com/public/images/Film/73257.jpg', 'https://phim.nguonc.com/public/images/Film/73257.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(221, 'Wind Breaker', 'wind-breaker', 'WIND BREAKER', 13, 'Haruka Sakura không muốn dính dáng gì đến những kẻ yếu đuối anh ấy chỉ quan tâm đến kẻ mạnh nhất trong kẻ mạnh. Anh ấy mới bắt đầu học tại trường trung học Furin, một ngôi trường gồm những học sinh thoái hóa chỉ được biết đến nhờ sức mạnh chiến đấu sức mạnh mà họ sử dụng để bảo vệ thị trấn của mình khỏi bất kỳ ai muốn điều xấu. Nhưng Haruka không quan tâm đến việc trở thành anh hùng hay trở thành thành viên của bất kỳ đội nào anh ấy chỉ muốn chiến đấu để đạt đến đỉnh cao!', NULL, 'https://phim.nguonc.com/public/images/Film/141816.jpg', 'https://phim.nguonc.com/public/images/Film/141816.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(222, 'Tru Tiên', 'tru-tien', 'Jade Dynasty', 52, 'Duyên đến duyên đi, tình định tru tiên. Chuyển thể từ tiểu thuyết Tru Tiên của tác giả Tiêu Đỉnh kể về thiếu niên Trương Tiểu Phàm, một người một côn đối mặt với thế giới.', NULL, 'https://phim.nguonc.com/public/images/Film/3565.jpg', 'https://phim.nguonc.com/public/images/Film/3565.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(223, 'Sand Land: The Series', 'sand-land-the-series', 'SAND LAND: THE SERIES', 13, 'Trong tương lai xa, chiến tranh đã hủy diệt toàn bộ Trái đất, chỉ để lại một vùng đất hoang cằn cỗi, nơi nguồn cung cấp nước được kiểm soát bởi tên vua tham lam. Để tìm kiếm một hồ nước đã mất tích từ lâu, cảnh sát trưởng Rao đã nhờ đến sự giúp đỡ của vua quỷ... và bắt được con trai của nhà vua, Beelzebub, và trợ lý của ông ta, Thief. Bộ ba bất ngờ cùng nhau khởi hành băng qua sa mạc, đối mặt với rồng, kẻ cướp và kẻ thù nguy hiểm nhất... chính quân đội của Nhà vua!', NULL, 'https://phim.nguonc.com/public/images/Film/142114.jpg', 'https://phim.nguonc.com/public/images/Film/142114.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(224, 'Maou no Ore ga Dorei Elf wo Yome ni Shitanda ga, Dou Medereba Ii?', 'maou-no-ore-ga-dorei-elf-wo-yome-ni-shitanda-ga-dou-medereba-ii', 'An Archdemon\'s Dilemma: How to Love Your Elf Bride, I, the Demon Lord, Took a Slave Elf as My Wife, but How Do I Love Her?', 12, 'Zagan bị nhiều người kinh sợ vì cậu là một pháp sư xấu xa. Vừa khó hòa nhập vừa miệng lưỡi độc địa, cậu dùng cả ngày để nghiên cứu pháp thuật và xử lý những kẻ xâm phạm lãnh thổ của mình. Một ngày nọ cậu được mời tới một buổi đấu giá bí mật, và thứ cậu tìm được ở đó là một bé nô lệ elf xinh đẹp tuyệt trần, Nephy.', NULL, 'https://phim.nguonc.com/public/images/Film/141203.jpg', 'https://phim.nguonc.com/public/images/Film/141203.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(225, 'Bộ Tinh Ti: Nguyên Khởi', 'bo-tinh-ti-nguyen-khoi', 'Blader Soul', 18, 'Hai người lớn lên trong sự che chở của thế gia, hướng về bồng lai tiên giới trong tuyền thuyết. Cam Thạch băng qua, thuật sĩ tập kích, tinh thạch rèn luyện, đánh thức sức mạnh tiềm ẩn trong thân thể của họ, cũng đánh thức cả khát vọng mà họ chưa từng biết tới.', NULL, 'https://phim.nguonc.com/public/images/Film/hhninja-bo-tinh-ti-nguyen-khoi_250x350.jpg', 'https://phim.nguonc.com/public/images/Film/hhninja-bo-tinh-ti-nguyen-khoi_250x350.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(226, 'Đánh cắp', 'danh-cap', 'Stöld', 1, 'Trong phim chính kịch xúc động lấy cảm hứng từ sự kiện có thật này, người phụ nữ trẻ thuộc cộng đồng người Sámi bản địa ở Thụy Điển truy tìm một tên sát nhân để giải quyết ân oán.', '105 phút', 'https://phim.nguonc.com/public/images/Film/ovUBfip0EgyqHZYhVx4K0ZjFkgn.jpg', 'https://phim.nguonc.com/public/images/Film/9XpzE6GyGq9lz8W1bc0iIjKlHf9.jpg', 73, 7, '5', '1', '1', 'Elle-Márjá Eira', 'Elin Kristina Oskal, Martin Wallström, Lars-Ánte Wasara', 1, NULL, NULL, 1),
(227, 'Chim gõ kiến Woody đi trại hè', 'chim-go-kien-woody-di-trai-he', 'Woody Woodpecker Goes to Camp', 1, 'Sau khi bị đuổi khỏi rừng, Woody nghĩ rằng mình đã tìm được mái nhà cho quãng đời còn lại ở Trại Hè Woo Hoo. Nhưng rồi một thanh tra đe dọa đóng cửa trại.', '98 phút', 'https://phim.nguonc.com/public/images/Film/2ht32v5Y6YInjdPoj7cDbQjrLP2.jpg', 'https://phim.nguonc.com/public/images/Film/swxCQLkP1PPBAIdngEot3p76lzA.jpg', 73, 7, '5', '1', '1', 'Jon Rosenbaum', 'Eric Bauza, Kevin Michael Richardson, Tom Kenny', 1, NULL, NULL, 1),
(228, 'Vụ cướp chuyến bay 601', 'vu-cuop-chuyen-bay-601', 'The Hijacking of Flight 601', 6, 'Sau khi máy bay bị cướp, hai tiếp viên phải đánh lừa những kẻ tấn công họ giữa các cuộc đàm phán căng thẳng cả trên không lẫn trên mặt đất. Bộ phim dựa trên các sự kiện có thật.', '60 phút/tập', 'https://phim.nguonc.com/public/images/Post/2/SC92X58Q.jpg', 'https://phim.nguonc.com/public/images/Post/2/8RApHBkN.jpg', 73, 7, '5', '1', '1', 'David Pombo, Pablo Gonzalez, C.S. Prince', 'Mónica Lopera, Ángela Cano, Christian Tappan', 1, NULL, NULL, 1),
(229, 'Kono Subarashii Sekai ni Shukufuku wo! 3', 'kono-subarashii-sekai-ni-shukufuku-wo-3', 'KonoSuba: God\'s Blessing on This Wonderful World! 3', 11, 'Mùa 3 Kono Subarashii Sekai ni Shukufuku wo!', NULL, 'https://phim.nguonc.com/public/images/Film/141268.jpg', 'https://phim.nguonc.com/public/images/Film/141268.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(230, 'Spartacus: Chúa Tể Đấu Trường', 'spartacus-chua-te-dau-truong', 'Spartacus: Gods of the Arena', 6, '<p>Trước khi Spartacus hạ gục đối thủ đầu tiên của mình trên đấu trường, đã có rất nhiều đấu sĩ vượt qua cổng để lên bãi cát. Trong phần tiền truyện này, Ngôi nhà của Batiatus đang trên đà phát triển, đắm mình trong ánh hào quang của nhà vô địch khét tiếng Gannicus, người có kỹ năng sử dụng kiếm chỉ phù hợp với cơn khát rượu và phụ nữ. Đây là thời điểm mà Batiatus trẻ tuổi đã chờ đợi.</p>', '53 phút/tập', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-dac-biet-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-dac-biet-poster.jpg', 73, 7, '5', '1', '1', 'Rick Jacobson, John Fawcett', 'John Hannah, Manu Bennett, Peter Mensah', 1, 1, NULL, 1),
(231, 'Spartacus: Máu và cát (Phần 3)', 'spartacus-mau-va-cat-phan-3', 'Spartacus (Season 3)', 10, '<p>Spartacus, quyết tâm lật đổ Cộng hòa La Mã, hiện đang lãnh đạo một cuộc nổi dậy của hàng ngàn nô lệ được giải phóng. Lãnh đạo La Mã Gaius Claudius Glaber đã chết, và các đối thủ cũ là Naevia, Crixus, Gannicus và Agron trở thành các tướng nổi dậy, tham gia cùng Spartacus trong cuộc chiến chống lại đế chế. Thượng viện La Mã quay sang một chính trị gia và quân nhân tàn nhẫn, Marcus Crassus, để hạ bệ nô lệ. Crassus nhận một ngôi sao trẻ đang lên - Julius Caesar - làm đồng minh.</p>', '53 phút/tập', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-3-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-3-poster.jpg', 75, 7, '2', '1', '1', 'Jesse Warn, Michael Hurst, John Fawcett', 'Liam McIntyre, Dustin Clare, Manu Bennett, Cynthia Addai-Robinson, Jaime Murray', 1, NULL, NULL, 1),
(232, 'Spartacus: Máu và cát (Phần 1)', 'spartacus-mau-va-cat-phan-1', 'Spartacus (Season 1)', 13, '<p>Bị chia cắt khỏi quê hương và người phụ nữ anh yêu, Spartacus bị kết án với thế giới đấu trường tàn bạo, nơi máu và cái chết là trò giải trí hàng đầu. Nhưng không phải trận chiến nào cũng diễn ra trên bãi cát. Sự phản bội, tham nhũng và sự quyến rũ của thú vui nhục dục sẽ liên tục thử thách Spartacus. Để tồn tại, anh ta phải trở thành hơn cả một người đàn ông. Hơn cả một đấu sĩ. Anh ấy phải trở thành một huyền thoại.</p>', '53 phút/tập', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-1-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-1-poster.jpg', 75, 7, '2', '1', '1', 'Jesse Warn, Michael Hurst, Rick Jacobson', 'Liam McIntyre, Dustin Clare, Manu Bennett, Cynthia Addai-Robinson, Jaime Murray', 1, NULL, NULL, 1),
(233, 'Spartacus: Máu và cát (Phần 2)', 'spartacus-mau-va-cat-phan-2', 'Spartacus (Season 2)', 10, '<p>Sau cuộc chạy trốn đẫm máu khỏi Ngôi nhà của Batiatus, cuộc nổi dậy của các đấu sĩ vẫn tiếp tục và bắt đầu gieo rắc nỗi sợ hãi vào trung tâm của Cộng hòa La Mã. Gaius Claudius Glaber và quân đội La Mã của ông ta được cử đến Capua để tiêu diệt nhóm nô lệ được trả tự do đang ngày càng gia tăng do Spartacus lãnh đạo trước khi họ có thể gây thêm thiệt hại. Spartacus được đưa ra lựa chọn giữa việc thỏa mãn nhu cầu cá nhân của mình để trả thù người đàn ông đã kết án vợ mình làm nô lệ và cuối cùng là cái chết hoặc hy sinh nhiều hơn cần thiết để giữ cho đội quân mới chớm nở của mình không bị tan rã.</p>', '53 phút/tập', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-2-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/cuoc-chien-cua-no-le-phan-2-poster.jpg', 73, 7, '5', '1', '1', 'Jesse Warn, Michael Hurst, Rick Jacobson', 'Liam McIntyre, Dustin Clare, Manu Bennett, Cynthia Addai-Robinson, Jaime Murray', 1, NULL, NULL, 1),
(235, 'Mãnh Hổ Võ Lâm', 'manh-ho-vo-lam', 'Shaolin Brave Tiger', 30, 'Mãnh Hổ Võ Lâm bắt đầu trận chiến ác liệt khi Chu Thần Quân vì dã tâm hoàng vị đã bán đứng anh em nối giáo cho giặc và lợi dụng Dương Thứ cùng Thiên Thu cho sự nghiệp của mình. Dù buồn đau trước sự phản bội của người anh em kết nghĩa nhưng hai người quyết tâm cùng nhau tiêu diệt tên bán nước…', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/2/0c8068f45b45be47.jpg', 'https://phim.nguonc.com/public/images/Post/2/Img3583660_n.jpg', 73, 7, '5', '0', '1', NULL, 'Thích Tiểu Long, Huỳnh Diệp, Ô Tĩnh Tĩnh', 1, NULL, NULL, 1),
(237, 'Chuyện tình Bangkok: Là em', 'chuyen-tinh-bangkok-la-em', 'Bangkok Love Stories: Objects of Affection', 13, 'Anh thợ sửa máy tính tốt bụng phải lòng nữ nghệ sĩ graffiti sành đời, nhưng chứng rối loạn đa nhân cách của cô lại nặng hơn sau khi cô chứng kiến vụ giết hại hai phụ nữ.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/2/nEr04f.jpg', 'https://phim.nguonc.com/public/images/Post/2/MjIzMTQzNDE%40__V1_.jpg', 73, 7, '2', '2', '2', 'Toom Preedaporn Buatoom', 'Apinya Sakuljaroensuk, Kanokchat Munyadon, Gyeon Seo', 1, NULL, NULL, 1),
(239, 'Thư Sinh Xinh Đẹp', 'thu-sinh-xinh-dep', 'In a Class of Her Own', 36, 'Các đồng môn đều biểu lộ vẻ mặt ngạc nhiên không nói lên lời. Cô gái bần hàn Cúc Tịnh Y cải trang thành nam nhân để được học ở học đường Vân Thượng, với nam thần Tống Uy Long, Tất Văn Quân cùng nhau học tập. Câu chuyện thanh xuân “độc đáo sáng tạo” bắt đầu từ đây.', '42 Phút/Tập', 'https://phim.nguonc.com/public/images/Film/thu-sinh-xinh-dep-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/thu-sinh-xinh-dep-poster.jpg', 73, 7, '1', '2', '1', 'Zhi Lei', 'Cúc Tịnh Y, Tống Uy Long, Tất Văn Quân, Vương Thụy Xương, Trần Nhất Long', 1, NULL, NULL, 1),
(241, 'Dã Thú Sơ Sinh (phần 1)', 'da-thu-so-sinh-phan-1', 'Wild Babies (season 1)', 8, 'Theo dõi cuộc phiêu lưu của sư tử con, voi, chim cánh cụt, tê tê và nhiều hơn thế nữa khi chúng học cách điều hướng các đỉnh cao của cuộc sống trong môi trường hoang dã.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/2/XWn8G.jpg', 'https://phim.nguonc.com/public/images/Post/2/NdTe8hPQ.jpg', 73, 7, '1', '1', '1', NULL, 'Helena Bonham Carter', 1, NULL, NULL, 1),
(242, 'Ninja Rùa Đột Biến', 'ninja-rua-dot-bien', 'TMNT', 1, 'Khi thế giới bị đe dọa bởi một ác quỷ cổ xưa, bốn chú rùa tuổi teen phải đoàn tụ và khắc phục lỗi lầm của mình để chống lại nó.', '1h 27m', 'https://phim.nguonc.com/public/images/Film/MV5BMjE1MzcwNTE5OV5BMl5BanBnXkFtZTcwMTIxNzQ0MQ@@._V1_.jpg', 'https://phim.nguonc.com/public/images/Film/MV5BMTIwMTc4ODk5MV5BMl5BanBnXkFtZTYwMjkzMDc2._V1_.jpg', 76, 7, '2', '2', '1', 'Kevin Munroe', 'Patrick Stewart, Mako, Chris Evans', 1, NULL, NULL, 1),
(244, 'Gặp Lại Tiêu Dao', 'gap-lai-tieu-dao', 'Sword and Fairy 1', 40, 'Tiểu nhị Lý Tiêu Dao có ước mơ trở thành đại hiệp tình cờ gặp được Triệu Linh Nhi, hậu duệ của Nữ Oa. Họ kết bạn và cùng nhau đi tìm Thủy Linh Châu có thể chấm dứt nạn hạn hán khắp thiên hạ. Trên đường đi, họ lần lượt kết giao với nhiều người bạn cùng chí hướng như oan gia Lâm Nguyệt Như, thư sinh nho nhã Lưu Tấn Nguyên... Cả nhóm cùng nhau vượt qua khó khăn, nguy hiểm để tìm kiếm linh châu, đập tan âm mưu đáng sợ là hủy diệt cả thế giới của Bái Nguyệt giáo chủ.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/PostCategory/1wE7Eb_4f.jpg', 'https://phim.nguonc.com/public/images/Post/PostCategory/602Ad0_3f.jpg', 73, 7, '2', '1', '1', 'Yang Long', 'He Yu, Hu Yi Xuan, Li Chuan, Xu Hao, Yang Yu Tong, Ye Sheng Jia', 1, NULL, NULL, 1),
(245, 'Thám Tử Sugar (phần 1)', 'tham-tu-sugar-phan-1', 'Sugar (season 1)', 8, 'Điều tra viên tư nhân John Sugar điều tra vụ mất tích bí ẩn của Olivia Siegel, cháu gái của một nhà sản xuất huyền thoại Hollywood.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/1/459099730_sugar-s01.jpg', 'https://phim.nguonc.com/public/images/Post/1/p26676623_b_h9_aa.jpg', 73, 7, '5', '1', '1', 'Fernando Meirelles, Adam Arkin', 'Colin Farrell, Kirby, Amy Ryan', 1, NULL, NULL, 1),
(252, 'Trường Sinh Bất Tử', 'truong-sinh-bat-tu', '1000 Years Old', 12, '1000 Years Old The Series kể về Phan đã sống một cuộc đời cực kỳ dài nhưng anh vẫn chưa quá hai mươi lăm tuổi. Đúng, Phan không phải là người bình thường. Anh ta có dòng máu mà một số người có thể gọi là ma cà rồng. Phan sống một mình, khiêm tốn - như bao người bình thường. Một ngày nọ, anh gặp một sinh viên tên Yo. Yo trở thành người đầu tiên mà Phan tin tưởng và chấp nhận bước vào cuộc đời anh, và không hề nhận ra điều đó, thứ gọi là tình yêu bắt đầu phát triển giữa con người và ma cà rồng.', '45 phút/tập', 'https://phim.nguonc.com/public/images/PostCat/rN0JAj_4f.jpg', 'https://phim.nguonc.com/public/images/PostCat/BL-1000-Years-Old-1000-YO-2024-1.jpg', 73, 7, '5', '1', '1', 'Champ Weerachit Thongjila', 'May Varisara Asawapattanakun, Mild Satita Sinsamnao, Opal Kritsapatorn Napawiwattanakul, Poon Mitpakdee', 1, NULL, NULL, 1),
(253, 'Thừa Hoan Ký', 'thua-hoan-ky', 'Best Choice Ever', 38, 'Thừa Hoan Ký là bộ phim được quay dựng dựa trên tiểu thuyết cùng tên của tác giả Diệc Thư. Lấy nhân vật Mạch Thừa Hoan làm trung tâm, Thừa Hoan Ký có nội dung xoay quanh hành trình trưởng thành, khẳng định bản thân và tìm được hạnh phúc của cô nàng Mạch Thừa Hoan đồng thời khắc họa những tình cảm, mâu thuẫn trong gia đình cô nàng.Mạch Thừa Hoan và bạn trai Tân Gia Lượng yêu nhau nhiều năm, cuối cùng cũng quyết định đi đến kết hôn. Thế nhưng, lúc này, sự chênh lệch về kinh tế giữa 2 nhà, việc kiểm soát quá nhiều của mẹ Mạch, gia đình bạn trai gặp biến cố,…đã khiến chuyện tình giữa hai người tan vỡ.Nhận ra sự bao bọc, kiểm soát quá đã của ba mẹ đồng thời muốn theo đuổi sở thích riêng và khẳng định bản thân, Mạch Thừa Hoan vừa “đấu tranh” với ba mẹ vừa cố gắng hoàn thành tốt công việc của mình. Sự thay đổi và cố gắng của Thừa Hoan khiến kế tổ mẫu của cô rất tán thưởng và quyết định giao việc quản lý khách sạn cho cô. Trong quá trình làm việc tại đây, Mạch Thừa Hoan gặp Diêu Chí Minh – cháu ruột của kế tổ mẫu đồng thời là giám đốc điều hành của khách sạn. Nhiều lần hợp tác, cả hai dần nảy sinh tình cảm, cùng nhau phát triển trong công việc và cả trong mối quan hệ giữa hai người. Cuối cùng, sau bao nỗ lực, Mạch Thừa Hoan cũng tìm được hạnh phúc thực sự cho mình – đó là một gia đình hạnh phúc, một công việc yêu thích và khẳng định được giá trị của bản thân.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/qYAvRK_4f.jpg', 'https://phim.nguonc.com/public/images/Post/2w70p2_3f.jpg', 73, 7, '5', '1', '1', 'Điền Vũ, Vương Thành Hân', 'Dương Tử, Hứa Khải, Ngưu Tuấn Phong, Amelie Xu, Diêu An Liêm', 1, NULL, NULL, 1),
(254, 'H (Phần 2)', 'h-phan-2', 'Hache (season 2)', 6, 'Một năm sau, Hache nắm lấy cơ hội mở phòng thí nghiệm sản xuất heroin, nhưng cộng sự mưu mô và họ hàng rắc rối làm phức tạp kế hoạch của cô.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/1/TMxODk2OTU%40__V1_.jpg', 'https://phim.nguonc.com/public/images/Post/1/11451_162865_updates.jpg', 73, 7, '5', '1', '1', 'Jorge Torregrossa, Fernando Trullols', 'Adriana Ugarte, Eduardo Noriega, Marc Martínez', 1, NULL, NULL, 1),
(255, 'H (Phần 1)', 'h-phan-1', 'Hache (Season 1)', 8, '<p>Có được tình yêu và sự tin tưởng của trùm băng đảng ma túy nguy hiểm ở Barcelona những năm 60, Helena dần mài dũa những kĩ năng cần có để từng bước vươn lên.</p>', '50 phút/tập', 'https://phim.nguonc.com/public/images/Film/h-phan-1-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/h-phan-1-poster.jpg', 73, 7, '5', '1', '1', 'Jorge Torregrossa, Fernando Trullols', 'Adriana Ugarte, Eduardo Noriega, Marc Martínez, Pep Ambròs, Núria Prims', 1, NULL, NULL, 1),
(258, 'Ai Cũng Khao Khát Được Gặp Em', 'ai-cung-khao-khat-duoc-gap-em', 'Everyone Wants to Meet You', 36, '\"Tổng tài bá đạo\" Trương Triết Hãn bắt tay với \"Nữ sinh không hoàn hảo\" Chương Nhược Nam, một bộ phim đáng xem năm 2020, iQIYI thực hiện trở lại phim tình yêu thuần khiết ~ vết thương và hàn gắn, tình yêu và tình cảm đan xen chặt chẽ, hát lên bài hát tình yêu chữa lành vết thương, lãng mạn, dịu dàng.', '42 Phút/Tập', 'https://phim.nguonc.com/public/images/Film/ai-cung-khao-khat-duoc-gap-em-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/ai-cung-khao-khat-duoc-gap-em-poster.jpg', 73, 7, '5', '1', '1', 'Xu Fu Xiang', 'Chương Nhược Nam, Trần Hạo Lam, Vương Dĩ Luân', 1, NULL, NULL, 1),
(259, 'Này! Đại Sự Của Cậu Thật Kỳ Diệu', 'nay-dai-su-cua-cau-that-ky-dieu', 'Hey, Your Big Business Is Wonderful', 24, 'Này! Đại Sự Của Cậu Thật Kỳ Diệu xoay quanh cuộc sống của Hùng Kỳ Kỳ và Lê Nhất Hòa, là đôi bạn từ nhỏ lớn lên ở vùng nông thôn yên bình. Cả hai vì muốn học tập và phát triển sự nghiệp mà cùng nhau lên thành phố lớn. Tuy nhiên, xã hội hiện thực nơi phố lớn không đơn giản như họ tưởng, vô vàn khó khăn, cạm bẫy ập tới với cả hai. Sau tất cả, Hùng Kỳ Kỳ trở về thị trấn nông thôn nơi từng sống với Lê Nhất Hòa và bắt đầu hòa nhập lại với môi trường xung quanh để có thể bước về phía trước. Mối quan hệ của họ cũng dần trở lại như thuở ban đầu...', '35 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/1/a_100478300_m_601_vi_260_360.jpg', 'https://phim.nguonc.com/public/images/Post/1/a_100478300_m_601_vi_480_270.jpg', 73, 7, '5', '1', '1', 'Chen Shi Yi, Gavin', 'Tu Zhi Ying, Ngô Vũ Hằng, Li You Xi', 1, NULL, NULL, 1),
(262, 'Vỏ Bọc Ma', 'vo-boc-ma', 'Ghost in the Shell', 1, 'Scarlett Johansson vào vai trong Vỏ Bọc Ma với hình ảnh lộng lẫy, một bộ phim phiêu lưu hành động lấy bối cảnh thế giới tương lai nơi con người được cải tiến bằng công nghệ. Tin rằng mình được cứu khỏi cái chết, Major (Johansson) trở thành cá thể đầu tiên trong loài của cô: trí não con người trong cơ thể nhân tạo được thiết kế để thực thi cuộc chiến chống tội ác điện tử. Khi điều tra một tội phạm nguy hiểm, Major phát hiện ra sự thật choáng váng - tập đoàn tạo ra cô đã dối trá về cuộc đời của cô trước đây để điều khiển cô. Hoang mang không biết tin vào gì, Major bất chấp mọi điều nhằm làm sáng tỏ bí mật về thân thế thực của bản thân và để báo thù tổ chức mà cô được tạo nên để phụng sự.', '107 phút', 'https://phim.nguonc.com/public/images/Film/4cQp6PBZJe8KjMgfk89KhFyycTH.jpg', 'https://phim.nguonc.com/public/images/Film/dDVqfmCzSy3TKSmiS2pJ9QB5E3P.jpg', 75, 7, '1', '1', '1', 'Rupert Sanders', 'Scarlett Johansson, Takeshi Kitano, Michael Pitt', 1, NULL, NULL, 1),
(263, 'Quý Cô Sát Chồng', 'quy-co-sat-chong', 'Drowning by Numbers', 1, 'Cissie Colpitts (Joan Plowright) dìm chết người chồng dối trá của mình và để che đậy điều đó bà ta đã nhờ đến sự giúp đỡ của nhân viên điều tra Henry Madgett (Bernard Hill), một người bạn cũ vốn có điểm yếu là xiêu lòng trước sự quyến rũ của Cissie. Nhưng khi con gái của Cissie (Juliet Stevenson) và cháu gái (Joely Richardson) đều quyết định sử dụng cùng một cách thức để giải quyết xung đột với người chồng họ, những người phụ nữ nhà Colpitts và những yêu cầu giúp đỡ liên tục của họ bắt đầu khiến Madgett cảm thấy cắn rứt lương tâm...', '119 phút', 'https://phim.nguonc.com/public/images/Film/7VSvsr87TazqEvxqTDTWMDCbjwt.jpg', 'https://phim.nguonc.com/public/images/Film/h9ndC0gPubKlcxCYDHr1Zxt2XyF.jpg', 75, 7, '2', '1', '1', 'Peter Greenaway', 'Joan Plowright, Juliet Stevenson, Joely Richardson', 1, NULL, NULL, 1),
(265, 'X-Men ’97', 'x-men-97', 'X-Men \'97', 11, 'Một nhóm dị nhân sử dụng tài năng kỳ lạ của mình để bảo vệ một thế giới ghét bỏ và sợ hãi họ, họ bị thách thức hơn bao giờ hết, buộc phải đối mặt với một tương lai mới đầy nguy hiểm và bất ngờ.', '30 phút/tập', 'https://phim.nguonc.com/public/images/Post/PostCategory/xmenhellfire2023001-xmen97-variant-1690229461767.jpg', 'https://phim.nguonc.com/public/images/Post/PostCategory/Screen-Shot-2021-11-12-at-9_25_46-AM.jpg', 74, 7, '2', '1', '1', 'Jake Castorena, Chase Conley', 'Ray Chase, Jennifer Hale, Alison Sealy-Smith', 1, NULL, NULL, 1),
(266, 'Chúng Ta Đáng Yêu Như Thế', 'chung-ta-dang-yeu-nhu-the', 'Lovely Us', 16, '<p>Mùa hè năm 2007, Thế vận hội Olympic chính thức bước vào giai đoạn đếm ngược một năm, cuối cùng khu nhà công nhân viên chức Thụ Đức cũng chào đón một đợt di dời toàn bộ, sau khi chào tạm biệt tòa nhà ngang với bản sonata của hồi ức và âm thanh nồi niêu gáo chậu, rồi ôm ấp kỳ vọng vào căn hộ riêng lẻ lạ lẫm, mới tinh. Mà tất cả những điều nhỏ nhặt có liên quan đến việc trưởng thành, ước mơ cùng với tính cảm mập mờ xảy đến với Hoàng Tranh Tử, Đàm Tống, Chúc Kim Tiêu, Hạ Kim Triêu cũng trở thành dấu ấn ấm áp nhất của khu nhà Thụ Đức</p>', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Film/chung-ta-dang-yeu-nhu-the-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/chung-ta-dang-yeu-nhu-the-poster.jpg', 73, 7, '2', '1', '1', 'Cattree', 'Li Ming De, Tian Xi Wei, You Hao Ran, Silvery', 1, NULL, NULL, 1),
(268, 'Tìm Mẹ', 'tim-me', 'Lion', 1, 'Như rất nhiều đứa trẻ sinh ra ở vùng nông thôn rộng lớn và nghèo khó của Ấn Độ vào thập niên 1980, Saroo chưa bao giờ có cơ hội tận hưởng cảm giác no đủ khi mẹ cậu phải một mình gánh vác ba đứa con nheo nhóc bằng nghề khuân vác trong các mỏ đá ở ngoại vi thành phố Khandwa. Bỗng dưng bị số phận đưa đẩy tới một thành phố xa lạ, nơi người dân thậm chí còn chẳng sử dụng thứ ngôn ngữ ở quê nhà, Saroo một mình đối mặt với muôn vàn khó khăn: từ những cơn đói triền miên, đến nỗi nhớ mẹ, nhớ anh trai da diết, và cả hiểm họa thường trực từ những kẻ lòng lang dạ thú muốn lạm dụng lũ trẻ ngây thơ như cậu. Dù vẫn tồn tại những tấm lòng nhân hậu muốn giúp đỡ Saroo tìm về với gia đình, nhưng tất cả những gì cậu có thể mô tả cho họ chỉ là Guddu - tên người anh trai, và “Ginestley” - tên ngôi làng nghèo quê hương nhưng chẳng thể tìm thấy ở bất cứ đâu trên tấm bản đồ Ấn Độ.', '118 phút', 'https://phim.nguonc.com/public/images/Film/iBGRbLvg6kVc7wbS8wDdVHq6otm.jpg', 'https://phim.nguonc.com/public/images/Film/fgffluhvdOv79SkYaKrfRA0xkf4.jpg', 76, 7, '1', '1', '1', 'Garth Davis', 'Dev Patel, Rooney Mara, David Wenham', 1, 1, NULL, 1),
(269, 'Trận chiến Mặt trận phía Tây', 'tran-chien-mat-tran-phia-tay', 'Battle for the Western Front', 1, 'Battle for the Western Front (2022) là một bộ phim chiến tranh được lấy cảm hứng từ phi công chiến đấu người Canada trong Thế chiến I, Billy Bishop. Phim kể về hai binh sĩ trẻ gặp nạn ở mặt trận vào tháng 8 năm 1918. Khi đồng minh bị giữ lại, đơn vị của họ phải cố gắng giữ vững cùng với tay súng bắn tỉa huyền thoại Anishinaabe, Francis “Peggy” Pegahmagabow', '90 phút', 'https://phim.nguonc.com/public/images/Film/oOJJdX2tP5KF0D67nwTuO3k9jtJ.jpg', 'https://phim.nguonc.com/public/images/Film/2QR0OpYzPFG84EswxENqcPuHmP.jpg', 75, 7, '2', '1', '1', 'Aaron Huggett', 'Christopher Cordell, Michael Lake, Sylvain Plasse', 1, 1, NULL, 1),
(274, 'Tích Hoa Chỉ', 'tich-hoa-chi', 'Blossoms in Adversity', 40, 'Hoa phủ cao quý hiển hách bất ngờ bị tịch biên và lưu đày, chỉ còn lại phụ nữ cùng trẻ em bơ vơ. Đại tiểu thư Hoa Chỉ không còn giả vờ ngốc nghếch giấu dốt nữa, cô dẫn dắt phụ nữ trong nhà trình diễn \"màn lột xác của phụ nữ quyền quý\", thoát khỏi cảnh đói rét và nguy hiểm trong muôn vàn chông gai. Cô còn biến ty sứ Thất Túc là Cố Yến Tích dũng mãnh vô song thành \"Yến tiên sinh\", người thương mà ai nấy đều yêu mến. Trong suốt hành trình có cãi vã, có mặn nồng, từ một tiểu thư khuê các gặp nạn, Hoa Chỉ cũng trưởng thành và trở thành người chủ gia đình, hướng tới một cuộc sống mới rực rỡ.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/PostCategory/WP3lAR_4f.jpg', 'https://phim.nguonc.com/public/images/Post/PostCategory/rNE1Ej_3f.jpg', 73, 7, '1', '1', '1', 'Chu Yui Bun', 'Bian Cheng, Caesar Wu, Hu Yi Tian, Lu Yu Xiao, Myolie Wu, Zhang Jing Yi', 1, NULL, NULL, 1),
(275, 'Hình Cảnh Quốc Tế', 'hinh-canh-quoc-te', 'Interpol', 40, 'Tiểu Miêu, Tử Ngôn, Hỏa Điểm, Triển Ký, Trần Phi … là những hình cảnh quốc tế tài ba. Họ là một đội tiên phong chuyên điều tra những tên tội phạm khét tiếng liên quốc gia. Tính cách mỗi người mỗi khác. Người lạnh lùng, nghiêm túc; kẻ sôi nổi, phóng túng … nhưng khi bắt tay vào công việc, họ luôn mang một tinh thần chiến đấu quả cảm, sát cánh bên nhau, phối hợp ăn ý để cùng hoàn thành nhiệm vụ và quan trọng là bảo vệ cuộc sống an lành cho người vô tội.\r\nLà lời nguyền giữa tận cùng uất ức của Tào Uyển Nhi trước khi gieo mình xuống giếng?\r\nLà nỗi oán hận của Thẩm Bích Vân khi suýt bỏ mình bởi định kiến khắc nghiệt của Tuyên gia?\r\nHay tất cả chỉ là cái cớ cho một mưu đồ trả thù đã được sắp đặt khéo léo từ rất lâu?\r\nVới sự tham gia diễn xuất của Trương Mông, Hàn Đống, Ngô Thiến, Ngụy Tử', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/1/HinhCanhQuocTe.jpg', 'https://phim.nguonc.com/public/images/Post/1/hinh-canh-quoc-te-1997-big.jpg', 74, 7, '1', '1', '1', NULL, 'Quan Lễ Kiệt, Đặng Tụy Văn, Phương Trung Tín, Lâm Vỹ Thần, Lưu Tùng Nhân, Dương Cung Như', 1, NULL, NULL, 1),
(276, 'Khi Trái Đào Chín', 'khi-trai-dao-chin', 'The 33D Invader', 1, 'Năm 2046, hành tinh Sucker đã làm trái đất thay đổi khi biến 99% đàn ông mất khả năng duy trì giống nòi. Liên hợp quốc đã chọn ra một phụ nữ khỏe mạnh, đặt tên là “Tương lai” để gửi đến trái đất vào thời điểm năm 2011 vơi mục đích gặp một nam nhi khỏe mạnh để tạo ra những giống nòi cường tráng cho trái đất. Tuy niên hành tinh Sucker đã cử 2 tinh binh của chúng là Sucker số 1 và Sucker số 2 xuống ngăn chặn kế hoạch này', '82 Phút', 'https://phim.nguonc.com/public/images/Film/khi-trai-dao-chin-thumb.jpg', 'https://phim.nguonc.com/public/images/Film/khi-trai-dao-chin-poster.jpg', 76, 7, '5', '1', '1', 'Chin Man-Kei', 'Akiho Yoshizawa, Monna Lam, Wu Qing-Qing, Law Kar-Ying, Samuel Leung Cheuk-Moon', 1, NULL, NULL, 1),
(279, 'Tề Thiên Đại Thánh (2002)', 'te-thien-dai-thanh-2002', 'The Monkey King: Quest for the Sutra', 35, 'Tề Thiên Đại Thánh do Trương Vệ Kiện thủ vai đã mang lại một phong cách mới cho Tây Du Ký. Với phong cách hài hước Tề Thiên Đại Thánh (Trương Vệ Kiện) đã làm cho người xem có nhiều trận cười thoải mái nhất.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/2/9vkBGf.jpg', 'https://phim.nguonc.com/public/images/Post/2/25ba.jpg', 73, 7, '5', '1', '1', 'Trang Vĩ Kiến', 'Trương Vệ Kiện, Lương Hán Văn, Cát Dân Huy, Lý Xán Sâm, Hứa Chí An, Thái Trác Nghiên, Chung Hân Đồng, Lý San San, Tăng Giang, Điềm Nữu, Trịnh Tú Văn, Trương Tây', 1, NULL, NULL, 1),
(280, 'Liêu Trai Tứ Đại Kỳ Nữ', 'lieu-trai-tu-dai-ky-nu', 'The Fairies Of Liaozhai', 38, 'Phim chuyển thể từ nguyên tác Liêu Trai, gồm 4 câu chuyện: Hiệp Nữ, Tân Thập Tứ Nương, Liên Thành và Hoạn Nương kể về những kỳ nữ liêu trai xinh đẹp vừa lung linh huyền ảo với những màu sắc truyền kỳ của số phận, vừa đa tình lãng mạn bởi những chuyện tình trong sáng, nhưng cũng chất chứa đầy khí phách \"anh hùng hiệp nữ\" bằng một niềm tin bất biến vào sự chiến thắng ác tà… Kỳ nữ Di Dương, một tiểu thư khuê các đem lòng yêu Ôn Như Xuân là tài tử tài hoa nổi tiếng của một gánh hát. Kỳ nữ Liên Thành, con gái một đại sử gia yêu say đắm sĩ tử Kiều Sinh, một người có ngoại hình tuấn tú cùng một tấm lòng lương thiện. Đây là một mối tình chất chứa nhiều bi thương và thù hận. Kỳ nữ Hiệp Nữ, con gái viên tuần bộ yêu thích võ nghệ, tính tình cương trực. Cho đến một hôm yêu ma xuất hiện phá vỡ cuộc sống hạnh phúc của cô cùng Cố đại phu, Hiệp Nữ lại dấn thân diệt trừ cái ác, bảo vệ tình yêu và hạnh phúc. Kỳ nữ Tân Thập Tứ Nương xinh đẹp, bản thân lại là một hồ ly, luôn làm việc thiện để tích công đức với ước nguyện tu luyện thành tiên. Một ngày kia, cô đã ra tay cứu giúp và để lại trong Phùng Sinh, một con người quân tử, không mê tửu sắc một mối tình si. Thế nhưng cuộc đời quá trái ngang khi buộc cô phải hy sinh cả mạng sống của mình để cứu người yêu thoát khỏi tai ương của bọn tà ma. Bốn kỳ nữ trong phim là những nhân vật thông minh, luôn hành động cao thượng và lãng mạn trong tình yêu, chắc chắn sẽ để lại dấu ấn đẹp trong lòng người xem.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/2/QL80_.jpg', 'https://phim.nguonc.com/public/images/Post/2/68779.jpeg', 73, 7, '5', '1', '1', 'Lý Quốc Lập', 'Trần Hiểu Đông, Phạm Văn Phuơng, Ngô Kỳ Long, Tae, Phan Việt Minh, Tăng Lê, Tôn Hưng, Lý Thanh, Lâm Gia Vũ, Lưu Thi Thi, Tôn Lợi', 1, NULL, NULL, 1),
(285, 'Thành Trung Chi Thành', 'thanh-trung-chi-thanh', 'City of the City', 40, 'Thanh niên trẻ ở thị trấn Đào Vô Kỵ được chi nhánh ven sông của Ngân hàng Thâm Mậu tuyển dụng, bắt đầu làm từ vị trí thấp nhất là nhân viên quầy, còn bạn gái của anh là Điền Hiểu Tuệ, một cô gái Thượng Hải được chị họ giới thiệu vào công ty ký gửi. Cả hai hẹn ước sẽ phát triển trong ngành tài chính và cố gắng sớm định cư ở Thượng Hải. Đào Vô Kỵ làm việc chăm chỉ và nỗ lực, bộc lộ tài năng nên được giám đốc chi nhánh Triệu Huy, trưởng phòng kiểm toán Miêu Triệt nhìn trúng, dốc lòng bồi dưỡng, dần dần tìm ra ý nghĩa và phương hướng làm việc của mình ở ngân hàng; Còn Hiểu Tuệ sau khi gia nhập công ty ký gửi phải đối mặt với cuộc sống khắc nghiệt, từng bước tiến lên nhưng nhận ra rằng trong thế giới tiền bạc này, cả hai đều đối mặt với nhiều thách thức và thử thách. Vô Kỵ và Hiểu Tuệ, Triệu Huy và Miêu Triệt, hai thế hệ nhà tài chính trải qua sự lựa chọn nghề nghiệp và vận mệnh thăng trầm, đối mặt với cám dỗ và khó khăn, họ phải lần lượt đưa ra lựa chọn, liệu họ sẽ nước chảy bèo trôi hay không quên sơ tâm, đầu xuôi đuôi lọt?', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/RBkL1o_4f.jpg', 'https://phim.nguonc.com/public/images/Post/a_100570114_m_601_en_720_405.jpg', 73, 7, '2', '1', '1', 'Hua-Tao Teng', 'Bạch Vũ Phàm, Yu He Wei, Xia Meng', 1, 0, NULL, 1),
(287, 'Ám Hà Truyện', 'am-ha-truyen', 'An He Chuan', 26, 'Tổ chức sát thủ thần bí nhất giang hồ, do Tam gia tộc họ Tô - Tạ - Mộ lập thành, thống soái tối cao của tam gia sẽ xưng là Đại gia trưởng. Trong người Đại gia trưởng mang kịch độc, sinh mạng nguy kịch sớm chiều. Sau khi thế lực ngầm của ba nhà biết tin, bèn nhân cơ hội phát động phản loạn.', NULL, 'https://phim.nguonc.com/public/images/Film/1690948599.jpg', 'https://phim.nguonc.com/public/images/Film/1690948599.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(288, 'Tuyệt Thế Võ Hồn', 'tuyet-the-vo-hon', 'Jue Shi Wu Hun, 绝世武魂', 440, 'Câu chuyện trong phim Tuyệt Thế Võ Hồn kể về Long Mạch đại lục, vạn tộc san sát, tông môn vô số, võ giả vi tôn. Cường giả hủy thiên diệt địa, kẻ yếu phủ phục như kiến. Vào thời điểm đó xuất hiện Thiếu niên Trần Phong, đan điền như thiết, vô pháp tu liên, nhận hết mắt lạnh. Ngẫu nhiên đến chí tôn long huyết, thần bí cổ đỉnh, từ đây nghịch thiên quật khởi, ngang trời xuất thế.', NULL, 'https://phim.nguonc.com/public/images/Film/Tuyet-The-Vo-Hon-320x449.jpg', 'https://phim.nguonc.com/public/images/Film/Tuyet-The-Vo-Hon-320x449.jpg', 73, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(289, 'Ta Dựa Vào Nạp Tiền Làm Võ Đế', 'ta-dua-vao-nap-tien-lam-vo-de', 'Make Money To Be King, Wo Kao Chongzhi Dang Wudi', 90, 'Người dùng tiền để trở thành vua võ thuật. vậy hành trình kiếm tiền và dùng tiền của nhân vật chính sẽ ra sao? liệu anh chàng có thực hiện được mục tiêu của mình?. Bộ phim với cốt truyện hấp dẫn , những màn võ đấu đầy xuất sắc sẽ không làm cho khán giả mãn nhãn chìm trong thế giới võ thuật này.', NULL, 'https://phim.nguonc.com/public/images/Film/ta-dua-vao-nap-tien-lam-vo-de11zon_250x350.jpeg', 'https://phim.nguonc.com/public/images/Film/ta-dua-vao-nap-tien-lam-vo-de11zon_250x350.jpeg', 74, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(290, 'Ninja Rùa: Hỗn Loạn Tuổi Dậy Thì', 'ninja-rua-hon-loan-tuoi-day-thi', 'Teenage Mutant Ninja Turtles: Mutant Mayhem', 1, '<p>Don Giorgio, một linh mục trẻ đẹp trai và là giáo viên trong một tu viện, có quan hệ tình cảm với hai người tình: Orchidea và Giulia. Khi ăn năn và thề sẽ quay trở lại Giáo hội, anh ta bị đánh đập dã man cho đến chết. Không lâu sau, Giulia bị rạch cổ họng. Thanh tra Boito yêu và chuẩn bị kết hôn với Orchidea, người cũng là nghi phạm chính. Chìa khóa để giải quyết vụ án dường như nằm ở cậu bé tò mò tên Ferruccio, người bị nhốt và đánh thuốc mê. Anh ta đã chứng kiến một trong những vụ giết người, nhưng liệu có ai tin câu chuyện của anh ta không?</p>', '100 Phút', 'https://phim.nguonc.com/public/images/Post/ueO9MYIOHO7M1PiMUeX74uf8fB9.jpg', 'https://phim.nguonc.com/public/images/Post/lich-chieu-phim-ninja-rua-hon-loan-tuoi-day-thi-1.jpg', 74, 7, '5', '1', '1', 'Jeff Rowe', 'Micah Abbey, Shamon Brown Jr., Nicolas Cantu, Brady Noon, Ayo Edebiri', 1, NULL, NULL, 1),
(291, 'Sói Và Gia Vị: Thương Nhân Gặp Sói Thông Thái', 'soi-va-gia-vi-thuong-nhan-gap-soi-thong-thai', 'Ookami to Koushinryou: Merchant Meets the Wise Wolf, Spice and Wolf: Merchant Meets the Wise Wolf, Spice and Wolf', 25, 'Dự án Remake của Ookami to Koushinryou (Sói và Gia Vị).', NULL, 'https://phim.nguonc.com/public/images/Film/142414.jpg', 'https://phim.nguonc.com/public/images/Film/142414.jpg', 74, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1),
(293, 'Tadaima, Okaeri', 'tadaima-okaeri', 'ただいま、おかえり', 12, 'Masaki là một Omega nam kết hôn cùng Hiromu là một Alpha nam. Hai người có một cậu con trai tên Hikari và vừa dọn đến thành phố mới để bắt đầu cuộc sống gia đình. Tác phẩm xoay quay những câu chuyện hằng ngày của cặp đôi này và cách họ nuôi dạy Hikari.', NULL, 'https://phim.nguonc.com/public/images/Film/139785.jpg', 'https://phim.nguonc.com/public/images/Film/139785.jpg', 74, 7, '5', '1', '1', NULL, NULL, 1, NULL, NULL, 1);
INSERT INTO `movie` (`id`, `name`, `slug`, `original_name`, `total_episodes`, `description`, `time`, `thumb_url`, `poster_url`, `id_category`, `id_country`, `id_genre`, `quality`, `language`, `director`, `casts`, `hot`, `hot_slider`, `trailer_url`, `status`) VALUES
(295, 'Tiếu Ngạo Giang Hồ (2001)', 'tieu-ngao-giang-ho-2001', 'State Of Divinity', 40, 'Tiếu ngạo giang hồ là câu chuyện xoay quanh cuộc chiến giữa các phe phái trong võ lâm Trung nguyên để giành được bí kíp võ công \"Tịch tà kiếm phổ\" huyền diệu của nhà họ Lâm. Nhân vật chính của \"Tiếu ngạo giang hồ\" là chàng trai lãng tử Lệnh Hồ Xung - đại đệ tử phái Hoa Sơn, một chàng trai nghĩa hiệp có tính cách lanh lợi, tư chất thông minh khác thường. Đau khổ vì bị người yêu Nhạc Linh San phụ bạc, bị đồng môn hiểu lầm và bị trục xuất khỏi sư môn, Lệnh Hồ Xung đã lang thang, phiêu bạt khắp nơi và trải qua biết bao sóng gió. Do may mắn, chàng đã được rất nhiều cao thủ võ lâm truyền thụ võ công và trở thành một trong những đệ nhất võ lâm ở Trung nguyên. Rồi hạnh phúc cũng mỉm cười với chàng trai có tấm lòng nhân ái, luôn biết hy sinh vì người khác. Chàng đã lọt vào mắt xanh của Thánh cô Ma giáo Niệm Doanh Doanh. Bị cuốn hút bởi tính cách của Hồ Xung, Doanh Doanh sẵn sàng từ bỏ danh lợi, chấp nhận hy sinh cả tính mạng để xả thân cứu người mình yêu. Hai con người với tình yêu sâu nặng đã cùng nhau phiêu bạt khắp thế gian để hợp tấu khúc \"Tiếu ngạo giang hồ\" do hai bậc tiền nhân là Khúc Dương và Lưu Chính Phong truyền lại cho hậu thế. \"Tiếu ngạo giang hồ\" là bài ca ca ngợi tình yêu cao đẹp, đức hy sinh và khao khát một cuộc sống không màng danh lợi, tiền bạc và quyền lực.', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/1/cgkgu4xHTRT.jpg', 'https://phim.nguonc.com/public/images/Post/1/tieu-ngao-giang-ho-2001.jpeg', 73, 7, '5', '1', '1', 'Hoàng Kiện Trung', 'Lý Á Bằng, Hứa Tình, Miêu Ất Ất, Lý Giải, Nguy Tử, Lã Hiếu Hòa, Trần Lệ Phong', 1, 0, NULL, 1),
(296, 'Hình Cảnh', 'hinh-canh', 'Gun Metal Grey', 30, 'Một viên cảnh sát hình sự, từ chỗ cứu người bỗng bị hàm oan liên quan đến vụ mưu sát, đã trút hết tất cả oan ức và sự phẫn nộ vào cuộc sống thực tại, và trở thành nhân vật nguy hiểm nhất của toàn đội điều tra. Truyện phim được lấy ‟chất liệu‟ từ mười vụ án lớn của Hong Kong, phản án sự phức tạp của tính cách con người, đồng thời hé mở những sự thật li kì. Thạch Đông Thăng (Huỳnh Nhật Hoa đóng) vốn là một cảnh sát chính trực, do liên quan đến một vụ mưu sát nên phải ngồi oan 15 năm mới tìm lại được công lý...', '45 Phút/Tập', 'https://phim.nguonc.com/public/images/Post/1/DU0MDI%40__V1_.jpg', 'https://phim.nguonc.com/public/images/Post/1/hinh-canh-2010-big.jpg', 73, 7, '5', '0', '1', 'Đường Cơ Minh, Tô Vạn Thông', 'Huỳnh Nhật Hoa, Miêu Kiều Vỹ, Tuyên Huyên, Hồ Định Hân, Vương Hạo Tín, Lương Liệt Duy, Tăng Vỹ Quyền, Văn Tụng Nhàn', 1, 0, NULL, 1),
(297, 'Cuộc Chiến Sinh Tồn: Hồi Sinh', 'cuoc-chien-sinh-ton-hoi-sinh', 'The Escape of the Seven: Resurrection', 16, 'The Escape of the Seven thuộc thể loại tội phạm bí ẩn, gay cấn, đặc biệt khác với phần lớn dự án khác thường chú trọng vào cái thiện, phim lại tập trung vào nhân vật phản diện với những ham muốn xấu xa đáng sợ. Bộ phim xoay quanh bảy người bị cuốn vào vụ án về sự biến mất đầy bí ẩn của một cô gái trẻ. Bảy người họ với hoàn cảnh xuất thân khác nhau cùng bị vướng vào vòng xoáy của sự dối trá, những cám dỗ và tham vọng đầy phức tạp, trói buộc họ với vụ án mất tích.', '70 phút/tập', 'https://phim.nguonc.com/public/images/Post/PostCategory/Bd3KQb_4f.jpg', 'https://phim.nguonc.com/public/images/Post/PostCategory/WP3bv3_3f.jpg', 73, 7, '5', '0', '1', 'Oh Jun-hyeok', 'Uhm Ki-joon, Hwang Jung-eum, Lee Joon', 1, 0, NULL, 1),
(298, 'Karasu wa Aruji wo Erabanai', 'karasu-wa-aruji-wo-erabanai', 'The Crow Does Not Choose the Lord, Yatagarasu: The Raven Does Not Choose Its Master', 20, 'Diễn ra trong thế giới Yamauchi, nơi quyền thống trị được nắm giữ bởi một gia tộc thuộc chủng tộc Yatagarasu chính hiệu. Karasu wa Aruji wo Erabanai thấy Yukiya, một Yatagarasu, bị lôi kéo vào âm mưu của Triều đình sau khi anh được chọn làm thị giả của một hoàng tử hoàng gia.', NULL, 'https://phim.nguonc.com/public/images/Film/141499.jpg', 'https://phim.nguonc.com/public/images/Film/141499.jpg', 74, 7, '5', '0', '1', NULL, NULL, 1, NULL, NULL, 1),
(299, 'Kiếm Tiên Ở Đây', 'kiem-tien-o-day', 'Jian Xian Zai Ci', 86, 'Lâm Bắc Thần một lần tình cờ có được một chiếc điện thoại di động, điện thoại đưa hắn vào một thế giới mang tên Đông Đạo Chân Châu kéo theo một loạt sự kiện sau đó.', NULL, 'https://phim.nguonc.com/public/images/Film/98953.jpg', 'https://phim.nguonc.com/public/images/Film/98953.jpg', 74, 7, '1', '1', '1', NULL, NULL, 1, 0, NULL, 1),
(301, 'Chốt Chặn Cuối Cùng', 'chot-chan-cuoi-cung', 'The Last Stand', 1, '<p>Cảnh sát trưởng Ray Owens đã rời khỏi Los Angeles và chuyển tới công tác tại một thị trấn vùng biên Sommerton Junction yên tĩnh. Tuy nhiên, cuộc sống yên bình của người dân nơi đây đã bị xáo trộn hoàn toàn khi Gabriel Cortez tên trùm buôn lậu khét tiếng nhất Tây bán cầu đã thực hiện thành công một cuộc đào tẩu mạo hiểm nhưng vô cùng ngoạn mục khỏi tay của FBI. Với sự trợ giúp của một nhóm những kẻ sống ngoài vòng pháp luật Cortez đã bắt theo một con tin và bắt đầu hành trình chạy trốn của mình hướng về biên giới Mỹ - Mexico.</p>', '107 phút', 'https://phim.nguonc.com/public/images/Film/chot-chan-cuoi-cung-thumb.jpg', 'https://phim.nguonc.com/public/images/Post/0f7kms1n_1920x1080-chotchancuoicung_782_432.jpeg', 75, 7, '1', '1', '1', 'Kim Jee-woon', 'Arnold Schwarzenegger, Johnny Knoxville, Jaimie Alexander, Forest Whitaker', 1, 0, NULL, 1);
